import queryString from 'query-string';


class OutLookOAuth extends React.Component {
  state = {
    access_token: ''
  }
  componentDidMount() {
    const accessHash = queryString.parse(this.props.location.hash);
    console.log(accessHash.access_token);
  }

  render() {
      return (
        <div></div>
      )
  }
}

export default OutLookOAuth;
